using Microsoft.AspNetCore.Http;
using System.IO;
using System;

namespace Tools
{
    public enum TypeImage
    {
        Ciudadano,
        Partido,
        Candidato
    }
    public static class Extentions
    {
        private static string _Path
        {
            get
            {
                var path = "C:\\Sistemavotaciones\\";
                Directory.CreateDirectory(path);
                return path;
            }
        }
        public static string SaveToDisk(this IFormFile file, string OldName)
        {
            Func<string> func = () =>
            {
                var extension = Path.GetExtension(file.FileName).ToLower();
                var fileName = Path.GetFileName(file.FileName);

                if (extension != ".jpg" && extension != ".jpeg" && extension != ".png")
                    throw new Exception("El formato del archivo no es valido.");

                if (File.Exists(_Path + OldName))
                    File.Delete(_Path + OldName);

                using (var fs = new FileStream(_Path + fileName, FileMode.Create))
                {
                    file.CopyTo(fs);
                }

                return fileName;
            };

            return file != null ? func() : OldName;

        }

        public static string Base64FromPath(this string FileName, TypeImage TypeImage)
        {
            var base64Image = string.Empty;

            switch (TypeImage)
            {
                case TypeImage.Ciudadano:
                    base64Image = "";
                    break;
                case TypeImage.Candidato:
                    base64Image = "";
                    break;
                case TypeImage.Partido:
                    base64Image = "";
                    break;
            }

            var byteArr = default(byte[]);

            if (File.Exists(_Path+FileName))
                byteArr = File.ReadAllBytes(_Path + FileName);

            return byteArr != null ? Convert.ToBase64String(byteArr) : base64Image;
        }
    }
}


